_adder__0023_003cgensym_002dscratch_0020_0023545_003e=_adder__003cp_003e('Adder is a Lisp-1 which compiles to Python.  It aims to\nintegrate seamlessly into Python: every Adder function is a Python\nfunction, every Adder list is a Python list, etc.\n')
